function Schedule() {
    return (
        <div>
            <ButtonGroup toggle className="mb-2">
                <ToggleButton
                type="checkbox"
                variant="secondary"
                checked={checked}
                value="1"
                onChange={(e) => setChecked(e.currentTarget.checked)}
                >
                Checked
                </ToggleButton>
            </ButtonGroup>
            <br />
            <ButtonGroup toggle>
                <ToggleButton
                    type="checkbox"
                    variant="secondary"
                    checked={checked}
                    value="1"
                    onChange={(e) => setChecked(e.currentTarget.checked)}
                    >
                    Checked
